// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./QHToken.sol";

contract EtherToQHT is Ownable {
  address private _token; // ERC20 token
  uint256 public _tokenPrice;
  address payable _to;

  constructor(address initialOwner) payable Ownable(initialOwner) {}

  function setERC20Contract(address _tokenAddress) public onlyOwner {
    _token = _tokenAddress;
  }

  function setERC20Price(uint256 _price) public onlyOwner {
    _tokenPrice = _price;
  }

  function setTeamWallet(address payable _teamWallet) public onlyOwner {
    _to = _teamWallet;
  }

  function etherToERC20(uint256 _amount) external payable {
    require(_token != address(0), "erc20 contract error.");
    require(_tokenPrice != 0, "token price error.");
    require(msg.value == _amount * _tokenPrice, "ether error.");
    _to.transfer(msg.value); //  
    QHToken(_token).mint(msg.sender, _amount * 10 ** 18);
  }
}
